import React from "react";
import {ModalContextProvider} from "../../redux/modalContext";

class Test extends React.Component {
  render() {
    return (
        <ModalContextProvider.Consumer>
        {theme => (
          <div className={`${theme}-image image`}>
            <div className={`${theme}-ball ball`} />
           dsf
          </div>
        )}
      </ModalContextProvider.Consumer>
    );
  }
}

export default Test;
